import React from 'react'
import '.css/ScrollStyle.css'
const Scroll =(props)=>{
    return (
        <div style={{overflowY:'scroll', border:'1px dotted gray', height:'80vh', scrollbarWidth: 'none', borderRadius:'10px'}}>
            {props.children}
        </div>
    )
}
export default Scroll;
